def find_nth_root(n: int, m: int) -> int:
    low = 2
    high = m
    while low <= high:
        mid = (low + high) // 2
        if pow(mid, n) == m:
            return mid
        if pow(mid, n) < m:
            low = mid + 1
        else:
            high = mid - 1
    return -1

